import { useState } from "react";
import { useAuthContext } from "../hooks/useAuthContext";

function Four() {
  return (
    <>
      <h1>Page Four!</h1>
      <td>
        <tr>happy</tr>
        <tr>go</tr>
        <tr>lucky</tr>
      </td>

      <ul>
        <li>What</li>
        <li>can</li>
        <li>YOu</li>
        <li>say or do</li>
      </ul>
    </>
  );
}

export default Four;
